sion of SMF.'';\nelse\n{\nvar smf_modificationInfo = {\n\n	3791: {\n		name: ''Delete All Mail Queue Button 1.0'',\n		versions: [''72'', ''74''],\n		desc: ''This modification adds an extra button &#039;Delete All&#039; to the Mail Queue Admin interface which makes it easier when deleting loads of mails in the Queue.'',\n		file: ''von COLLINZO-Delete All Mail Queue Button.zip''\n	},\n	3788: {\n		name: ''TopMenu by BK-Modding 1.0'',\n		versions: [''74''],\n		desc: ''<strong>TopMenu by BK-Modding</strong><br /><br />Version: 1.0 Date: September 29, 2013<br />Compatibility: <strong>SMF 2.0.x</strong><br /><br />Made by: <a href="http://www.simplemachines.org/community/index.php?action=profile;u=194815" class="bbc_link" target="_blank">BK Modding Team</a> - <a href="http://www.bkmodding.com/" class="bbc_link" target="_blank">BK-Modding</a><br /><br />This modification makes a fixed top bar with the menu located in it.<br />This was originally a <a href="http://www.simplemachines.org/community/index.php?topic=444219.msg3123598#msg3123598" class="bbc_link" target="_blank">post</a> by: <a href="http://www.simplemachines.org/community/index.php?action=profile;u=129726" class="bbc_link" target="_blank">Antechinus</a><br /><br /><strong>NOTES: This mod is for Curve (Default) theme and may well not work on custom themes and will require per-theme changes for them.<br />Since this mod does css changes, you will need to clear your browser cache or do a hard refresh after install.</strong><br /><br /><strong>Support:</strong><br />You may get support or submit questions and comments in the modification&#039;s support topic at:<br /><a href="http://www.simplemachines.org/community/index.php" class="bbc_link" target="_blank">The SMF Site</a> or <a href="http://www.bkmodding.com/index.php" class="bbc_link" target="_blank">BK Modding</a><br /><br /><div align="center"><a href="http://creativecommons.org/licenses/by-sa/3.0/deed.en_US" class="bbc_link" target="_blank"><img src="http://i.creativecommons.org/l/by-sa/3.0/88x31.png" alt="" class="bbc_img" /></a><br />This work is licensed under a <a href="http://creativecommons.org/licenses/by-sa/3.0/deed.en_US" class="bbc_link" target="_blank">Creative Commons Attribution-ShareAlike 3.0 Unported License</a>.</div>'',\n		file: ''BK-Modding-TopMenu.zip''\n	},\n	3787: {\n		name: ''Footer Menu 1.1.2'',\n		versions: [''74''],\n		desc: ''<strong>Footer Menu</strong> 1.1.2 by live627<br /><hr /><br />This mod appends a menu to the bottom of the page. It shows everywhere.<br /><br />Admin settings are under the Forum sub-menu in the admin panel.<br /><br /><strong><em><span class="bbc_u">Changelog</span></em></strong><br /><span style="font-family: courier;" class="bbc_font"><br /><strong>1.1.2 - 15 Oct 2013</strong><br />! Footer cache would not refresh upon link deletion and some other actions<br /><br /><strong>1.1.1 - 12 Oct 2013</strong><br />! Encoring: UTF-8 was forced on all inputs<br />! URL got truncated to 40 characters; set the inew length to 400<br /><br /><strong>1.0 - 02nd Oct 2013</strong><br />Initial release submitted freely to mod site</span><br /><br /><hr /><br />Licence: <a href="http://creativecommons.org/licenses/by-nd/3.0/deed.en_GB" class="bbc_link" target="_blank">CC-BY-ND 3.0</a>&nbsp; <img src="http://i.creativecommons.org/l/by-nd/3.0/88x31.png" alt="" class="bbc_img" />'',\n		file: ''footer_menu_1_1_2.tar.gz''\n	},\n	2559: {\n		name: ''Another Link Tree 1.0'',\n		versions: [''53'', ''55'', ''58'', ''62'', ''64'', ''54'', ''57'', ''61'', ''63'', ''65'', ''68'', ''73''],\n		desc: ''<div align="center"><a href="http://www.smfpersonal.net/" class="bbc_link" target="_blank"><img src="http://www.smfpersonal.net/Adkmods/logo.png" alt="" class="bbc_img" /></a></div><hr /><div align="center"><span style="font-size: 1.45em;" class="bbc_size"><span style="color: purple;" class="bbc_color"><strong>Another Link Tree</strong></span></span></div><hr /><br /><strong>Autor:</strong><br />- lucas-ruroken<br /><table class="bbc_table"><tr><td>Perfil<br /><a href="http://custom.simplemachines.org/mods/index.php?action=profile;u=195264" class="bbc_link" target="_blank">My Mods</a><br /></td><td><a href="https://www.paypal.com/cgi-bin/webscr?cmd=_donations&amp;business=JX63M3JYP5F5E&amp;lc=AR&amp;item_name=Animedk&amp;item_number=47504637&amp;currency_code=USD&amp;bn=PP%2dDonationsBF%3abtn_donateCC_LG%2egif%3aNonHosted" class="bbc_link" target="_blank"><img src="https://www.paypal.com/en_US/i/btn/btn_donateCC_LG.gif" alt="" class="bbc_img" /></a><br /><strong>Help support my mods</strong><br /></td></tr></table><hr /><br />With this mod, you can change the default Link Tree.<br /><br /><span style="font-size: 1.45em;" class="bbc_size"><strong>For Support visit: <a href="http://www.smfpersonal.net" class="bbc_link" target="_blank">www.smfpersonal.net</a></strong></span>'',\n		file: ''AnotherLinkTree.zip''\n	}};\nvar smf_latestModifications = [3791, 3788, 3787];\n\nfunction smf_packagesMoreInfo(id)\n{\n	window.smfLatestPackages_temp = document.getElementById("smfLatestPackagesWindow").innerHTML;\n\n	setInnerHTML(document.getElementById("smfLatestPackagesWindow"),\n	''\\\n		<h3 style="margin: 0; padding: 4px;">'' + smf_modificationInfo[id].name + ''</h3>\\\n		<h4 style="padding: 4px; margin: 0;"><a href="'' + window.smfForum_scripturl + actionurl + ''http://custom.simplemachines.org/mods/downloads/'' + id + ''/'' + smf_modificationInfo[id].file + '';'' + window.smfForum_sessionvar + ''='' + window.smfForum_sessionid + ''">Install Now!</a></h4>\\\n		<div style="margin: 4px;">'' + smf_modificationInfo[id].desc.replace(/<a href/g, ''<a href'') + ''</div>\\\n		<div class="titlebg" style="padding: 4px; margin: 0;"><a href="javascript:smf_packagesBack();void(0);">(go back)</a></div>'');\n}\n\nfunction smf_packagesBack()\n{\n	setInnerHTML(document.getElementById("smfLatestPackagesWindow"), window.smfLatestPackages_temp);\n	window.scrollTo(0, findTop(document.getElementById("smfLatestPackagesWindow")) - 10);\n}\n\nwindow.smfLatestPackages = ''\\\n	<div id="smfLatestPackagesWindow"style="overflow: auto;">\\\n		<h3 style="margin: 0; padding: 4px;">New Packages:</h3>\\\n		<img src="http://www.simplemachines.org/smf/images/package.png" width="102" height="98" style="float: right; margin: 4px;" alt="(package)" />\\\n		<ul style="list-style: none; margin-top: 3px; padding: 0 4px;">'';\n\nfor (var i = 0; i < smf_latestModifications.length; i++)\n{\n	var id_mod = smf_latestModifications[i];\n\n	window.smfLatestPackages += ''<li><a href="javascript:smf_packagesMoreInfo('' + id_mod + '');void(0);">'' + smf_modificationInfo[id_mod].name + ''</a></li>'';\n}\n\nwindow.smfLatestPackages += ''\\\n		</ul>'';\n\nif (typeof(window.smfVersion) != "undefined" && (window.smfVersion < "SMF 1.0.6" || (window.smfVersion == "SMF 1.1 RC2" && !in_array(''smf:smf-1.0.7'', window.smfInstalledPackages))))\n	window.smfLatestPackages += ''\\\n		<h3 class="error" style="margin: 0; padding: 4px;">Updates for SMF:</h3>\\\n		<div style="padding: 0 4px;">\\\n			<a href="'' + window.smfForum_scripturl + actionurl + ''http://custom.simplemachines.org/mods/downloads/smf_patch_1.0.7_1.1-RC2-1.tar.gz;'' + window.smfForum_sessionvar + ''='' + window.smfForum_sessionid + ''">Security update (X-Forwarded-For header vulnerability)</a>\\\n		</div>'';\nelse\n	window.smfLatestPackages += ''\\\n		<h3 style="margin: 0; padding: 4px;">Package of the Moment:</h3>\\\n		<div style="padding: 0 4px;">\\\n			<a href="javascript:smf_packagesMoreInfo(2559);void(0);">Another Link Tree 1.0</a>\\\n		</div>'';\n\nwindow.smfLatestPackages += ''\\\n	</div>'';\n}\n\nfunction findTop(el)\n{\n	if (typeof(el.tagName) == "undefined")\n		return 0;\n\n	var skipMe = in_array(el.tagName.toLowerCase(), el.parentNode ? ["tr", "tbody", "form"] : []);\n	var coordsParent = el.parentNode ? "parentNode" : "offsetParent";\n\n	if (el[coordsParent] == null || typeof(el[coordsParent].offsetTop) == "undefined")\n		return skipMe ? 0 : el.offsetTop;\n	else\n		return (skipMe ? 0 : el.offsetTop) + findTop(el[coordsParent]);\n}\n\nfunction in_array(item, array)\n{\n	for (var i in array)\n	{\n		if (array[i] == item)\n			return true;\n	}\n\n	return false;\n}\n', 'text/javascript');
