andard Emoticons v1'',\n		versions: [''65'', ''68''],\n		desc: ''<div align="center"><img src="http://bit.ly/kZVDB6" alt="" width="443" height="115" class="bbc_img resized" /></div><br /><div align="center"><span style="text-shadow: black 1px 1px 1px"><span style="color: purple;" class="bbc_color"><span style="font-size: 16pt;" class="bbc_size"><strong>Standard Emoticons</strong></span></span></span><br /><strong>Developed by</strong> <strong><a href="http://www.smfsimple.com/index.php?action=profile;u=1045" class="bbc_link" target="_blank">Cesar</a></strong> <strong>for </strong><strong><a href="http://www.smfsimple.com" class="bbc_link" target="_blank">SMFSimple.com</a></strong><br /><em><strong>SMF 2.0 - 2.0.1</strong></em></div><br /><hr /><br /><div align="center"><span style="text-shadow: black 1px 1px 1px"><span style="color: orange;" class="bbc_color"><span style="font-size: 14pt;" class="bbc_size"><strong>El soporte oficial de los desarrolladores de nuestros mods lo encontraras en SMFSimple.com<br />Official Support in <a href="http://www.SmfSimple.com" class="bbc_link" target="_blank">www.SmfSimple.com</a></strong></span></span></span></div><br /><hr /><br /><span style="text-shadow: black 1px 1px 1px"><span style="color: orange;" class="bbc_color"><span style="font-size: 13pt;" class="bbc_size"><span class="bbc_u"><strong>Description:</strong></span></span></span></span><br /><em><strong>Emoticons Pack created by Powerpill and packaged by Cesar to SmfSimple.com</strong></em><br /><br /><span style="text-shadow: black 1px 1px 1px"><span style="color: orange;" class="bbc_color"><span style="font-size: 13pt;" class="bbc_size"><span class="bbc_u"><strong>Descripcion:</strong></span></span></span></span><br /><em><strong>Pack de Emoticones creados por Powerpill y empaquetados para SmfSimple.com por Cesar</strong></em><br /><br /><hr /><br /><div align="center"><span style="text-shadow: black 1px 1px 1px"><span style="color: red;" class="bbc_color"><span style=