;\n	}\n\n	return false;\n}', 'text/javascript'),
(6, 'latest-support.js', '/smf/', 'language=%1$s&version=%3$s', 'window.smfLatestSupport = ''<div style="font-size: 0.85em;"><div style="font-weight: bold;">SMF 2.0.5</div>Few vulnerabilities have been fixed in this new release.  Please <a href="http://www.simplemachines.org/download.php">try it</a> before requesting support.</div>'';\n\nif (document.getElementById(''credits''))\n	setInnerHTML(document.getElementById(''credits''), getInnerHTML(document.getElementById(''credits'')).replace(/thank you!/, ''<span onclick="alert(\\''Kupo!\\'');">thank you!</span>''));\n', 'text/javascript'),
(7, 'latest-themes.js', '/smf/', 'language=%1$s&version=%3$s', '\r\nvar smf_themeInfo = {\r\n	2707: {\r\n		name: ''Envision2013'',\r\n		desc: ''This is modern theme for SMF 2.0.x, a rewrite of an earlier theme. It has some options added to it:<br /><br />- option to add extra copyright line<br />- option to add Twitter/facebook/LinkedIn icons.<br />- option to add a custom footer, with 3 columns.<br />- option to show said columns on the right of the forum instead.'',\r\n		file: ''envision2013_smf20_rev3.zip'',\r\n		author: ''Bloc''\r\n	},\r\n	2724: {\r\n		name: ''Golove'',\r\n		desc: ''This theme may not work properly in old and non CSS3 supported browsers.<br /><br />License - Read included text file.<br /><br />License in brief, you can make any changes to this theme to fit your needs, however under no circumstance are you allowed to make any changes to the copyright link.<br /><br /><a href="http://theme.teknoromi.com/index.php?theme=5" class="bbc_link" target="_blank">Demo</a>'',\r\n		file: ''Golove.zip'',\r\n		author: ''snrj''\r\n	},\r\n	2723: {\r\n		name: ''Sinister'',\r\n		desc: ''Dark styled theme in Gray, Black and Red for SMF 2.0.x<br /><br />Features social icons in user bar that can be activated/deactivated and links edited from within current theme options.<br /><br />License - Read included text file.<br /><br />License in brief, you can make any changes to this theme to fit your needs, however under no circumstance are you allowed to make any changes to the copyright link.<br /><br /><img src="http://i.imgur.com/JBaQ77f.png" alt="" width="600" height="384" class="bbc_img resized" /><br /><br /><span style="color: teal;" class="bbc_color">This theme uses css3, therefor may not work correctly in older type browsers.</span><br /><br /><span style="color: teal;" class="bbc_color"><span style="font-size: 14pt;" class="bbc_size">Not recommended for RTL languages.</span></span><br /><br /><a href="http://www.hostxme.com/" class="bbc_link" target="_blank"><s