(18, 9, 1, 1377187203, 1, 71, '[Evento] ¿Quieres una cuenta premium de Minecraft?', 'Ikillnukes', 'ikillnukes1@gmail.com', '79.151.232.143', 1, 1379787301, 'Ikillnukes', '[font=verdana][size=11pt][b]Buenas Terrícolas,[/b] hoy os traigo un [size=12pt][color=green][b]super Evento[/b][/color][/size] [s]guapo de coj*nes[/s] que trata de conseguir [b][size=12pt][color=purple]cuenta premium en Minecraft[/color][/size][/b], [b]¿cómo funciona esto?[/b]<br />[b]Fácil,[/b] al usuario más activo después de x fecha (ahora dire cuando), ganará una [b][size=12pt][color=purple]cuenta premium en Minecraft[/color][/size][/b].<br /><br />[u][b]¿Qué hay que hacer para participar?[/b][/u][/size][/font]<br />[list]<br />[li][font=verdana][b]Lo primero si eres un visitante, es registrarte:[/b] [url=http://nexusplayers.x10host.com/index.php?action=register]http://nexusplayers.x10host.com/index.php?action=register[/url], [b]si no lo haces, ¿cómo vas a participar?[/b][/font][/li]<br />[li][font=verdana][b]Escribir por aquí, la palabra [u]&quot;Participo&quot;[/u] (sin comillas claramente)[/b], si quieres escribir algo, pon [u][b]&quot;PD:&quot;[/b][/u] gracias.[/font][/li]<br />[/list]<br /><br />[size=11pt][font=verdana][u][b]¿Qué hay que hacer para ser un usuario activo?[/b][/u][/font][/size]<br />[list]<br />[li][font=verdana][b]Crear post, que no contenga [color=red][u]ni Spam[/u][/color], [u][color=red]ni Basura Nuclear[/color][/u], [color=red][u]ni Flood[/u][/color], [u]ni nada por lo cual puedas ser baneado[/u].[color=red]*[/color][/b][/font][/li]<br />[li][font=verdana][b]Comentar por los posts ya existentes.[color=red]*[/color][/b][/font][/li]<br />[li][font=verdana][b]Participar en eventos ya creados[/b], como el de [url=http://nexusplayers.x10host.com/index.php?topic=4.msg5#msg5]Reclutamiento[/url].[/font][/li]<br />[li][font=verdana][b]Estando online,[/b] no sirve de mucho, pero te hará sumar algunos puntillos extra[/font].[/li]<br />[/list]<br /><br />[font=verdana][size=11pt][u][b]¿Cuando acabará el Evento?[/b][/u]<br />[b]El evento terminará dentro de 2 meses,[/b] contando desde ya, es decir, [b]22-10 (22 de Octubre de 2013)[/b] (pospuesto por falta de participantes...)<br /><br />[b][u]¿Cómo funciona esto?[/u][/b]<br />Cuando el [color=green][b]Evento[/b][/color] acabe [b]este post será cerrado[/b], [b]se miraran los participantes[/b] y [b]la actividad de cada uno[/b], [u](posts creados, comentarios, tiempo online y referels)[/u], todo esto con una [b]ecuación[/b] (regla de 3), se transformará en [b]puntos[/b], y el que más puntos tenga, pues gana. [u][b]¿Sencillo no?[/b][/u]<br /><br />[b][color=red]*[/color][u]Para los navegantes, ¡aviso!:[/u]<br />A todo aquel que se le ocurra incumplir las normas ya dictadas será fuertemente castigado.[/b]<br /><br />[b]Buena suerte a todo el mundo. Gracias por participar.<br />Un saludo.[/b][/size][/font]', 'xx', 1),
