(70, 29, 2, 1378833052, 2, 70, 'Duda con los &quot;credits&quot;', 'Alex', 'alexcondite94@hotmail.com', '212.145.90.172', 1, 1378833168, 'Roster', 'Tengo una pequeña dudilla que me está comiendo un poco el tarro ???<br /><br />Veamos... he visto que en los campos de perfil hay un campo nuevo llamado &quot;credits&quot; (créditos). ¿Para qué sirve este campo? Me imagino que tendrá algo que ver con intercambiar por algo o comprar cosas y tal [img]http://fehaxball.es/Smileys/aaron/descojone2.gif[/img]<br /><br />Pero lo que más me cuesta saber... [b]¿qué criterios hay para ganar o perder créditos?[/b] Lo pregunto porque yo por ejemplo ahora tengo, si mal no erro, 8 créditos, mientras que otros usuarios recién registrados tienen ¡¡20 créditos!! :o Y claro... no me cuadra algo. Luego hay algo llamado [b]&quot;inventory&quot; (inventario)[/b] que tampoco sé para qué sirve, ya que al intentar acceder me dice que no tengo permisos para verlo [img]http://fehaxball.es/Smileys/aaron/descojone2.gif[/img]. Suena interesante todo esto, eso sí, de ahí que pregunte y tal&nbsp; ;D <br /><br />Saludos y tal.<br /><br />EDIT: Veo que tiene que ver con mensajes posteados, ya que a cada hilo que abro, parece que regalan 10 créditos. Hmmm...', 'recycled', 1),
