(75, 30, 7, 1379788789, 1, 75, 'Prison Architect Alpha 13 [Español][Mediafire]', 'Ikillnukes', 'ikillnukes1@gmail.com', '2.138.91.244', 1, 1379790038, 'Ikillnukes', '[center][img]http://leviathyn.com/wp-content/themes/sahifa/timthumb.php?src=/wp-content/uploads/2013/04/Prison-Architect-Alpha-8-555x444.jpg&amp;h=330&amp;w=660&amp;a=c[/img]<br /><br />[b]Título:[/b] Prison Architect<br />[b]Género:[/b] Estrategia, Simuladores<br />[b]Desarrollador:[/b] Introversion Software<br />[b]Editor:[/b] Introversion<br />[b]Idiomas:[/b] Inglés-Español (customizable)<br />[b]Tamaño:[/b] 116,15 Mb<br /><br />[b]Acerca del Juego[/b]<br /><br />Prison Architect es la última gestión de prisiones del mundo. A partir de una parcela vacía de la tierra debe construir una celda con servicios básicos de agua y electricidad a la casa de su primer grupo de prisioneros, para comprar el tiempo suficiente para crear un pabellón adecuado. Usted tendrá que contratar algunos guardias, conseguir algunas duchas construidas ya menos que la cocina está en marcha con chefs trabajan lejos usted va a terminar con un motín en sus manos. A partir de ahí se toma la prisión en la que sin embargo la dirección que desee. Un centro de máxima seguridad o cómodo monsterous para la rehabilitación, la elección depende de usted.<br /><br /><br />Prison Architect está en Alfa que significa que el juego es jugable, pero aún está en desarrollo. No todas las funciones aún se aplican y hay muchos errores que pueden afectar a la jugabilidad. Actualmente estamos lanzando versiones actualizadas mensuales que incluyen nuevas características y correcciones de errores. Al comprar el alfa automáticamente será regalado una copia gratuita del juego completo cuando esté terminado.<br /><br /><br /><br /><br />[b]Capturas[/b]<br /><br />[img]http://cdn.steampowered.com/v/gfx/apps/233450/ss_0a77adf7d676af30ec6efe020cef075bd0821628.1920x1080.jpg?t=1372692282[/img]<br /><br />[img]http://cdn.steampowered.com/v/gfx/apps/233450/ss_04bc63e8747ab23ef3ba59b6515c5573d4ccff55.1920x1080.jpg?t=1372692282[/img]<br /><br />[img]http://cdn.steampowered.com/v/gfx/apps/233450/ss_8f18ce3a7a8ff514ee58b37bb443e48730f81850.1920x1080.jpg?t=1372692282[/img]<br /><br />[img]http://cdn.steampowered.com/v/gfx/apps/233450/ss_6c8328755897cc2e2d205c315286c7ead9eb6962.1920x1080.jpg?t=1372692282[/img]<br /><br />[img]http://cdn.steampowered.com/v/gfx/apps/233450/ss_789bfda3d097b619e1267b5b29dbb38b797f53b9.1920x1080.jpg?t=1372692282[/img]<br /><br />[img]http://cdn.steampowered.com/v/gfx/apps/233450/ss_3ac57b3e0a33fc44bb5410a4207caee928c46b14.1920x1080.jpg?t=1372692282[/img]<br /><br />[b][img]http://cdn.store.steampowered.com/public/images/v5/platforms/platform_win.png[/img] Requisitos del sistema (PC)[/b]<br /><br /><br />[b]Requisitos mínimos:[/b]<br />[list]<br />[*][b]OS:[/b]XP<br />[*][b]Processor:[/b]Intel Core2 Duo 2.4Ghz or Higher / AMD 3Ghz or Higher<br />[*][b]Memory:[/b]4 GB RAM<br />[*][b]Graphics:[/b]Nvidia 8600 / Radeon equivalent (2009 era)<br />[*][b]Hard Drive:[/b]100 MB HD space<br />[/list]<br /><br />[size=14pt][b]Descarga:[/b][/size]<br /><br />[url-lock]http://www.mediafire.com/download/ud33eu27z6c0gww/prisonarchitect-alpha13-pc.zip[/url-lock]<br /><br />[size=14pt][b]Traducción al Español by [url=http://nexusplayers.x10host.com/index.php?action=profile;u=84]Vangodp[/url]:[/b][/size]<br /><br />[url-lock]http://www.mediafire.com/?4xpxcr4x8el4yqc[/url-lock]<br /><br />[b]Minitutorial para cambiar el idioma:[/b]<br /><br />[spoiler]Van al archivo [b]main.dat[/b] del [b]rar[/b] y le hacen [b]doble click[/b], se van a la [b]subcarpeta &quot;language&quot;[/b] y [i]reemplazan[/i] el [b]english.txt[/b] por el que se [b]descargaron[/b].[/spoiler][/center]<br /><br />[b]Un saludo.[/b]', 'xx', 1),
