(82, 34, 1, 1381237353, 1, 82, '[Noticia] Caída repentina del Foro (por inactividad en la cuenta del Host)', 'Ikillnukes', 'ikillnukes1@gmail.com', '2.138.52.124', 1, 1381237469, 'Ikillnukes', '[b]Hola buenas,[/b] pues si, como sabréis (supongo), tengo un servidor gratuito que es la monda...[b] Y bueno,[/b] pues hay un pequeño problema, que es que si estoy sin 1 mes entero sin meterme dentro de la cuenta de la web pues el Host te suspende la cuenta... Por suerte, se puede volver a habilitar en menos de 5 minutos...<br /><br />[b]Básicamente[/b], para aquellos que tienen curiosidad por lo que pasaba, es que cuando alguien se metía a la web, automáticamente, te redireccionaba aquí: https://x10hosting.com/suspended<br /><br />[b]El caso,[/b] es que te avisan por Gmail, y el muy despistado de mí no había caído en esto:<br /><br />[img]http://gyazo.com/093317e7f100dc6dd81e311cebfb8eba.png[/img]<br /><br />Así que, perdonad las posibles molestias (para aquellos que no se pudieron descargar antes el Terraria 1.2 (juego que ahora esta relanzando esta web), y la posible gente que se divertía dentro del foro (muy poca :())<br /><br />[b]Un saludo. Y perdonen..[/b] :P', 'xx', 1),
